import React from "react";
import Clock from "react-live-clock";
import moment from "moment";

const Time = () => {
  return (
    <div className="time">
      <div className="date">{moment().format("MMMM Do YYYY d")}</div>
      <Clock format={"h:mm:ss a"} ticking={true} timezone={"EST"} />
    </div>
  );
};

export default Time;
